Ef notað var til að skrifa gefna kóða, sjálfgefið notað var til að "ef"-súmsíðu. Í þessu tilfelli, þessi súmsíðu lætir inn "20 > 18" (notað er enn meira kynna í kóðunni). Ef það er í mótunum, notar síðan "if" (dreift einkunnar út- og útgögn) til að glæði kenna í einkunnar útgögninni.

Þetta gefna kóða er dúttur af ef-súmsíðu:

```c
if (20 > 18) {
    printf("20 er stærri en 18");
}
```

source:
"Greinið forritunarmálið sem notað var til að skrifa gefna kóða.

ef (20 > 18) {
  printf("20 er stærri en 18");
}"
